import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';


const useStyles = makeStyles({
      root : {
         color : 'white',
         background : 'inherit',
         border : '1px solid'

      }
});

function SimpleDialog(props) {
  const classes = useStyles();

  return (
    <Dialog onClose={props.handleOpenclose} aria-labelledby="simple-dialog-title" open={props.open} maxWidth={'xs'}
         BackdropProps={{
  classes: {
   root : classes.root
  }
 }}
 PaperProps={{
  style: {
    minHeight: "20%",
    minWidth: "20%"
  }
 }}>
        <DialogContent style={{textAlign : 'center'}}>

            <DialogContentText id="alert-dialog-description" style={{marginTop : '30px', color : 'black'}}>
              {props.name._v} has been added to cart
            </DialogContentText>
       </DialogContent>
      <DialogActions>

            <Button onClick={props.handleOpenclose} color="primary">
              OK
            </Button>

      </DialogActions>
    </Dialog>
  );
}

export default SimpleDialog;
